        subtitle,
    })
    console.log(list);
    return (
        <div>
            {list.map(prpducts => (
                <div>
                    <p>id={id}</p>
                    <p>title={title}</p>
                    <p>subtitle={subtitle}</p>
                </div>
            ))}
        </div>
    );
};

export default ProductList;
